const MainHeader = () => {
  return (
    <div class="container">
      <div class="row">
        <div class="col"><h1>Welcome page here</h1></div>
        <div class="col"><p>Eth icon here</p></div>
      </div>
    </div>
  );
};

export default MainHeader;
